import React from 'react'
import Image from '../../images/avatar.png'
import { AvatarContainer, Img } from './AvatarElements'

const Avatar = () => {
    return (
        <>
            <AvatarContainer>
                <Img src={Image}/>
            </AvatarContainer>
        </>
    )
}

export default Avatar
